header {
    background-position: center;
    background-size: cover;
    
    
    ul {
        margin: 0;
        padding: 0;
        list-style-type: none;
    }
    
    nav {
        padding-top: 5%;
        width: 27.5%;
        font-family: "Roboto", sans-serif;
        font-weight: bold;
    }
    
    ul {
        display: flex;
        justify-content: space-between;
    }
    
    li {
        font-size: 2.5rem;
    }
    
    a {
        color: white;
        position: relative;
        padding: 0;
    }

    .currentLocation::after {
        content: '';
        width: 100%;
        height: 10%;
        background-color: $aqua;
        position: absolute;
        bottom: -5px;
    }

    .link:hover::after,
    .link:focus::after {
        content: '';
        width: 100%;
        height: 10%;
        background-color: $grey;
        position: absolute;
        bottom: -5px;
    }
    
    h1 {
        font-size: 14.25rem;
        font-weight: 400;
    }

    @media screen and (max-width: $XL) {
        nav {
            width: 40%;
        }
    }
    
    @media screen and (max-width: $medium) {
        nav {
            padding-top: 10%;
            width: 50%;
        }
    }

    @media screen and (max-width: $small) {

        .skipLinkVisibility {
            display: none;
        }
        
        nav {
            padding-top: 15%;
            width: 90%;
            margin: 0 auto;
        }
        
        ul {
            display: flex;
            flex-direction: row;
            justify-content: space-between;
        }
        
        li {
            font-size: 2rem;
            padding-bottom: 20%;
        }

