            color: $darkBlue;
            padding: 10px 50px;
        }
        
        input[type="submit"]:hover,
        input[type="submit"]:focus {
            background-color: white;
            color: $blue;
        }
        
        input:invalid,
        textarea:invalid {
            border-bottom: 5px solid $aqua;
        }
    }

